"use strict";
// Explication : Un type générique peut avoir une valeur par défaut.
// il peut être utilisé sans spécifier de type.
// il permet de créer des fonctions ou des classes flexibles.
const exemple1 = { valeur: "Bonjour" };
const exemple2 = { valeur: 42 };
console.log(`Exemple 1: ${exemple1.valeur}`);
console.log(`Exemple 2: ${exemple2.valeur}`);
